import React, { Component } from 'react';
import BoxUsuario from './boxes/BoxUsuario';
import BoxLogin from './boxes/BoxLogin';

class App extends Component {
   render() {
      return (
         <div className="container">
            <h1 className="text-center">Documentação Api</h1>

            <span className="alerta">Sempre que derem um pull, não se esqueçam de rodar o script do banco!!!</span>
 
            <div id="outterAccordion">
               
               <BoxUsuario/>
               <BoxLogin/>

            </div>
         </div>
      );
   }
}

export default App;
